import ReactDOM from 'react-dom';
import { BrowserRouter, Route }  from 'react-router-dom';
import TableCharacter from './TableCharacter';



ReactDOM.render(
<BrowserRouter>
    <Route path="/" component={TableCharacter} />
 
 </BrowserRouter> ,
 
  document.getElementById('root')
);
